css:
atom-text-editor,
:host {
  background-color: rgba(46, 0, 38, 0.87);
  color: #F7EBD6;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: rgba(46, 0, 38, 0.87);
  color: #F7EBD6;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: rgba(255, 255, 255, 0.06);
  color: #F7EBD6;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #F7EBD6;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: rgba(255, 255, 255, 0.25);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(255, 255, 255, 0.25);
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(255, 255, 255, 0.25);
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: rgba(255, 255, 255, 0.25);
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: #F7EBD6;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: rgba(255, 255, 255, 0.65);
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: #532075;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: rgba(255, 255, 255, 0.06);
}
.comment {
  color: #AEAEAE;
}
.constant {
  color: #D43384;
}
.entity {
  color: #FF7D73;
}
.keyword {
  color: #DCB476;
}
.storage {
  color: #DCB476;
}
.string,
.meta.verbatim {
  color: #56B380;
}
.support {
  color: #7CB6FF;
}
.variable {
  color: #BEABFF;
}
.invalid.deprecated {
  font-style: italic;
  color: #AB2A1D;
}
.invalid.illegal {
  color: #F8F8F8;
  background-color: #9D1E15;
}
.entity.other.inherited-class {
  font-style: italic;
  color: #FF6400;
}
.string .constant.other.placeholder {
  color: #FF6400;
}
.meta.function-call.py {
  color: #BECDE6;
}
.meta.tag,
.meta.tag .entity {
  color: #8090AA;
}
.entity.name.section {
  color: #FFFFFF;
}
.keyword.type.variant {
  color: #D5E0F3;
}
.source.ocaml .keyword.operator.symbol {
  color: #F8F8F8;
}
.source.ocaml .keyword.operator.symbol.infix {
  color: #8DA6CE;
}
.source.ocaml .keyword.operator.symbol.prefix {
  color: #8DA6CE;
}
.source.ocaml .keyword.operator.symbol.infix.floating-point {
  text-decoration: underline;
}
.source.ocaml .keyword.operator.symbol.prefix.floating-point {
  text-decoration: underline;
}
.source.ocaml .constant.numeric.floating-point {
  text-decoration: underline;
}
.text.tex.latex .meta.function.environment {
  background-color: rgba(255, 255, 255, 0.03);
}
.text.tex.latex .meta.function.environment .meta.function.environment {
  background-color: rgba(122, 150, 250, 0.03);
}
.text.tex.latex .support.function {
  color: #FBDE2D;
}
.source.plist .string.unquoted,
.source.plist .keyword.operator {
  color: #FFFFFF;
}
.string .constant {
  color: #469075;
}
